import React from 'react';

export default function VideoBanner() {
  const videoURL = 'gs://champagne-media/Champagne Therapy Video.mp4';
  return (
    <video width="750" height="500" controls autoplay>
      <source src={videoURL} type="video/mp4" />
    </video>
  );
}
